import React, {Component} from 'react';
import {getCV} from "../api/apiCalls";
import {loginSuccess} from "../redux/authActions";

class CvList extends Component {

    state = {
        isLoggedIn: true,
        cvs: []
    };

    componentDidMount() {
        getCV().then(response => {
            this.setState({
                cvs: response.data
            });
        });
    }

    render() {
        const {cvs, isLoggedIn} = this.state;
        return (
            <div>
                {cvs.map((cv,index) => {
                    return (
                        <div key={index}>
                            {loginSuccess(cv.name)}
                        </div>
                    );
                })}
            </div>
        );
    }
}

export default CvList;
